import React, {Component} from 'react'

class SearchBar extends Component {
    constructor(props) {
      super(props);

      this.handleSeachValueChange = this.handleSearchValueChange.bind(this);
    }

    handleSearchValueChange() {

    }

    render() {
      return (
        <div>
          <form>
            <input type="text" 
            className="aaaa" 
            value={this.props.filterText} 
            onChange={this.handleSeachValueChange.bind(this)}/>
            <br/>
            <input type="checkbox" value="true" /> Only show products in stock111
          </form>
        </div>
      );
    }
  }

  class FilterableProductTable extends Component {
    // eslint-disable-next-line no-useless-constructor
    constructor(props) {
      super(props);

      this.state = {filterText: 'book', inStockOnly: true};
    }

    render() {
      return (
        <div>
          <SearchBar filterText={this.state.filterText} inStockOnly={this.state.inStockOnly}/>
        </div>
      );
    }
  }

  export default FilterableProductTable;
